import * as React from "react";
import PropTypes from "prop-types";
import Typography from "@mui/material/Typography";
import Grid from "@mui/material/Grid";
import Card from "@mui/material/Card";
import CardActionArea from "@mui/material/CardActionArea";
import CardContent from "@mui/material/CardContent";
import CardMedia from "@mui/material/CardMedia";
import Divider from "@mui/material/Divider";
import Box from "@mui/material/Box";
import CHSLogo from "../assets/images/CHSLOGO.jpg";
import pbm from "../assets/images/pbm.jpg";
import pbmlogo from "../assets/images/pbmlogo.png";

import { useTheme, ThemeProvider, createTheme } from "@mui/material/styles";

function FeaturedPost() {
  const theme = useTheme();

  return (
    <Box
      sx={{
        width: "100%",
        margin: "auto",
        position: "relative",
        p: { xs: 3, md: 9 },
      }}
    >
      <Typography component="h1" variant="h4" color="inherit" gutterBottom>
        Here are some of my most recent projects:
      </Typography>

      <Grid container spacing={3}>
        <Grid item xs={12} md={6}>
          <Card sx={{ maxWidth: 345, margin: "auto" }}>
            <CardActionArea
              target="_blank"
              href="https://www.curtishomesolutions.com/"
            >
              <CardMedia
                component="img"
                width="140"
                image={CHSLogo}
                alt="green iguana"
              />
              <CardContent>
                <Typography gutterBottom variant="h5" component="div">
                  Curtis Home Solutions
                </Typography>
                <Typography variant="body2" color="text.secondary">
                  New business startup. Website, CRM, Email, invoicing.
                </Typography>
                <Typography variant="subtitle1" color="Inherit">
                  Tap to see the final product
                </Typography>
              </CardContent>
            </CardActionArea>
          </Card>
        </Grid>
        <Grid item xs={12} md={6}>
          <Card sx={{ maxWidth: 345 }}>
            <CardActionArea
              target="_blank"
              href="https://www.photosbymalaina.com/"
            >
              <CardMedia
                component="img"
                width="140"
                image={pbmlogo}
                alt="green iguana"
              />
              <CardContent>
                <Typography gutterBottom variant="h5" component="div">
                  Photos by Malaina
                </Typography>
                <Typography variant="body2" color="text.secondary">
                  Photography Portfolio. Website, Email.
                </Typography>
                <Typography variant="subtitle1" color="Inherit">
                  Tap to see the final product
                </Typography>
              </CardContent>
            </CardActionArea>
          </Card>
        </Grid>
      </Grid>
    </Box>
  );
}

export default FeaturedPost;
